read_group(Bin, FieldNum) ->
    {NumBytes, EndTagLen} = read_gr_b(Bin, 0, 0, 0, 0, FieldNum),
    <<Group:NumBytes/binary, _:EndTagLen/binary, Rest/binary>> = Bin,
    {Group, Rest}.

%% Like skipping over fields, but record the total length,
%% Each field is <(FieldNum bsl 3) bor FieldType> ++ <FieldValue>
%% Record the length because varints may be non-optimally encoded.
%%
%% Groups can be nested, but assume the same FieldNum cannot be nested
%% because group field numbers are shared with the rest of the fields
%% numbers. Thus we can search just for an group-end with the same
%% field number.
%%
%% (The only time the same group field number could occur would
%% be in a nested sub message, but then it would be inside a
%% length-delimited entry, which we skip-read by length.)
read_gr_b(<<1:1, X:7, Tl/binary>>, N, Acc, NumBytes, TagLen, FieldNum) when N < (32 - 7) ->
    read_gr_b(Tl, N + 7, X bsl N + Acc, NumBytes, TagLen + 1, FieldNum);
read_gr_b(
    <<0:1, X:7, Tl/binary>>,
    N,
    Acc,
    NumBytes,
    TagLen,
    FieldNum
) ->
    Key = X bsl N + Acc,
    TagLen1 = TagLen + 1,
    case {Key bsr 3, Key band 7} of
        % 4 = group_end
        {FieldNum, 4} ->
            {NumBytes, TagLen1};
        % 0 = varint
        {_, 0} ->
            read_gr_vi(Tl, 0, NumBytes + TagLen1, FieldNum);
        % 1 = bits64
        {_, 1} ->
            <<_:64, Tl2/binary>> = Tl,
            read_gr_b(Tl2, 0, 0, NumBytes + TagLen1 + 8, 0, FieldNum);
        % 2 = length_delimited
        {_, 2} ->
            read_gr_ld(Tl, 0, 0, NumBytes + TagLen1, FieldNum);
        % 3 = group_start
        {_, 3} ->
            read_gr_b(Tl, 0, 0, NumBytes + TagLen1, 0, FieldNum);
        % 4 = group_end
        {_, 4} ->
            read_gr_b(Tl, 0, 0, NumBytes + TagLen1, 0, FieldNum);
        % 5 = bits32
        {_, 5} ->
            <<_:32, Tl2/binary>> = Tl,
            read_gr_b(Tl2, 0, 0, NumBytes + TagLen1 + 4, 0, FieldNum)
    end.

read_gr_vi(<<1:1, _:7, Tl/binary>>, N, NumBytes, FieldNum) when N < (64 - 7) ->
    read_gr_vi(Tl, N + 7, NumBytes + 1, FieldNum);
read_gr_vi(<<0:1, _:7, Tl/binary>>, _, NumBytes, FieldNum) ->
    read_gr_b(Tl, 0, 0, NumBytes + 1, 0, FieldNum).

read_gr_ld(<<1:1, X:7, Tl/binary>>, N, Acc, NumBytes, FieldNum) when N < (64 - 7) ->
    read_gr_ld(Tl, N + 7, X bsl N + Acc, NumBytes + 1, FieldNum);
read_gr_ld(<<0:1, X:7, Tl/binary>>, N, Acc, NumBytes, FieldNum) ->
    Len = X bsl N + Acc,
    NumBytes1 = NumBytes + 1,
    <<_:Len/binary, Tl2/binary>> = Tl,
    read_gr_b(Tl2, 0, 0, NumBytes1 + Len, 0, FieldNum).

merge_msgs(Prev, New) when element(1, Prev) =:= element(1, New) ->
    merge_msgs(Prev, New, element(1, Prev), []).

merge_msgs(Prev, New, MsgName) when is_atom(MsgName) ->
    merge_msgs(Prev, New, MsgName, []);
merge_msgs(Prev, New, Opts) when
    element(1, Prev) =:= element(1, New),
    is_list(Opts)
->
    merge_msgs(Prev, New, element(1, Prev), Opts).

merge_msgs(Prev, New, MsgName, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
        'ResponseObject' ->
            merge_msg_ResponseObject(Prev, New, TrUserData);
        'Match.Player' ->
            'merge_msg_Match.Player'(Prev, New, TrUserData);
        'Match' ->
            merge_msg_Match(Prev, New, TrUserData);
        'AccountNewReq' ->
            merge_msg_AccountNewReq(Prev, New, TrUserData);
        'AccountNewResp' ->
            merge_msg_AccountNewResp(Prev, New, TrUserData);
        'AccountLoginReq' ->
            merge_msg_AccountLoginReq(Prev, New, TrUserData);
        'AccountLoginResp.Player' ->
            'merge_msg_AccountLoginResp.Player'(
                Prev,
                New,
                TrUserData
            );
        'AccountLoginResp' ->
            merge_msg_AccountLoginResp(Prev, New, TrUserData);
        'PlayerNewReq' ->
            merge_msg_PlayerNewReq(Prev, New, TrUserData);
        'PlayerNewResp' ->
            merge_msg_PlayerNewResp(Prev, New, TrUserData);
        'PlayerAuthenticate' ->
            merge_msg_PlayerAuthenticate(Prev, New, TrUserData);
        'PlayerLog' ->
            merge_msg_PlayerLog(Prev, New, TrUserData);
        'LobbyInfo' ->
            merge_msg_LobbyInfo(Prev, New, TrUserData);
        'MatchCreateReq' ->
            merge_msg_MatchCreateReq(Prev, New, TrUserData);
        'MatchCreateResp' ->
            merge_msg_MatchCreateResp(Prev, New, TrUserData);
        'MatchJoinReq' ->
            merge_msg_MatchJoinReq(Prev, New, TrUserData);
        'MatchJoinResp' ->
            merge_msg_MatchJoinResp(Prev, New, TrUserData);
        'MatchLeaveReq' ->
            merge_msg_MatchLeaveReq(Prev, New, TrUserData);
        'MatchLeaveResp' ->
            merge_msg_MatchLeaveResp(Prev, New, TrUserData)
    end.

